script: |
  super -f text -I q11333.spq | sort > q11333.out

inputs:
  - name: q11333.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE 53 NOT BETWEEN - + col2 + col2 * col1 AND + 4 * - + col0 - col0 - - ( 47 );
  - name: tab2

outputs:
  - name: q11333.out
    data: |
      46	51	23
      64	77	40
      75	67	58
